import { Head } from "next/head";
import Header from "./Header";
import Footer from "./Footer";
const Layout = (props) => {
  return (
    <div className="layout">
      <Head></Head>
      <Header />
      <div className="layout">{props.children}</div>
      <Footer />
    </div>
  );
};

export default Layout;
